import { Box } from '@mui/material'
import React from 'react'

const HomePage = () => {
  return (
    <Box width={'100%'} height={'100%'} marginTop={2} margin="auto">
      <Box margin={'auto'} width={'80%'} height={'40%'} padding={2}>

        <img src='https://i.ytimg.com/vi/bweRG6WueuM/maxresdefault.jpg' alt='Brahmastra' width={'100%'} height={'100%'}></img>
      </Box>

    </Box>
  )
}

export default HomePage
